  \"completed\"\n\t},\n\t{\n\t\t\"key\": \"access_constraints\",\n\t\t\"value\": \"[\"Use
  Constraints: Neither the Arctic Landscape Conservation Cooperative, BLM, USFWS,
  or contributors to this dataset shall be held liable for improper or incorrect use
  of the data described and/or contained herein. In an effort to provide the most
  comprehensive overview possible, we have incorporated many data sources, representing
  many different survey methods. It is not possible to apply a uniform quantification
  of survey effort across this wide variety of data sets because not all of the yellow-billed
  loons observations are associated with a clearly defined survey area. Therefore,
  the user should avoid aggregating data from multiple sources to derive density estimates.
  When interpreting these data, users are reminded to consider that detectability
  of loons is a function of many variables, including differences in species, habitat,
  time-of-year, weather conditions, and survey techniques. Inherent in any data set
  used to develop graphical representations, are limitations of accuracy as determined
  by, among others, the source, scale and resolution of the data.\", \"Access Constraints:
